import { Component} from 'react';
import Api from '../../services/api';
import { Link } from 'react-router-dom'


export default class Profile extends Component{

    state = {};

    componentDidMount(){
        const config = {
            headers:{
                Authorization:localStorage.getItem('token')
        }
        
    }
    Api.get('showProfile',config).then(
        res =>{
            this.setState({
                userDoctor:res.data
            })
        },
        err =>{
            console.log(">>>>>erro home>>>>>>>>>>>",err);
        }
    )
    };

    signUp(){
        localStorage.clear();
        window.location.href='/'
    }
    
    render() {

        if(this.state.userDoctor){
            return(
                <div>
                    <table  className="form">
                        <tr>
                        <th>ID </th>
                        <br></br>
                        <th>NOME </th>
                        <br></br>
                        <th>EMAIL </th>
                        <br></br>
                        <th>ESPECIALIZAÇÃO </th>
                        <br></br>
                        <th>TELEFONE </th>
                        <br></br>
                    </tr>
                        <tr>
                        <td>{this.state.userDoctor.id}</td>
                        <br></br>
                        <td>{this.state.userDoctor.name}</td>
                        <br></br>
                        <td>{this.state.userDoctor.email}</td>
                        <br></br>
                        <td>{this.state.userDoctor.specialization}</td>
                        <td>{this.state.userDoctor.phone}</td>
                        </tr>
                        <tr>
                        <td><Link to ={`/profilePerfil/${this.state.userDoctor.id}`}>Editar Perfil</Link></td>
                        <br></br>
                        <td><Link to ={`/justificationEnable/${this.state.userDoctor.id}`}>Inativar Perfil</Link></td>
                    </tr>
                    </table>
                </div>      
            )
        }
        

        return (
            <div>
             
            
           
            
            </div>
            
        )
    }
}
